import React, {Component} from 'react';
import './style.css';

class Vote extends Component{
  render(){
    return(
      <div>
        <header>
          <h1>Ideation Pool</h1>
          <p>Vote on the most useful idea!</p>
        </header>
      </div>
    )
  }
}
export default Vote;
